import styles from "./Header.module.css"
import mealsPhoto from "../../../meals.jpeg"

const Header = () => {

    return (
        <Fragment>
            <header className={styles.appBar}>
                <h3>SPICYMEALS</h3>
                <button>Cart</button>

            </header>
            <img className={styles.foodPic} src={mealsPhoto} alt="Food Table"></img>
        </Fragment>
    );
}

export default Header;
